import NavBar from "componets/NavBar";
import Footer from "componets/Footer";

function App() {
  return (
    <>
      <div className="container">
        <NavBar />
        <h1 className="text-primary">Hello World!</h1>
      </div>
      <Footer />
    </>
  );
}

export default App;
